package FindAllAnagramsInAString;

import java.util.*;

public class Main {


    public static void main(String[] args) {
        String s = "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                "" +
                "" +
                "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                ""
;
        String p ="";

        findAnagrams(s,p).stream().forEach(System.out::println);
    }

    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> solList = new ArrayList<>();
        Map<Character, Integer> hMapP = new HashMap<>();
        int lenP = p.length();
        int lenS = s.length();
        for (int i = 0; i < lenP; ++i) {
            Character currChar = p.charAt(i);
            hMapP.put(currChar, hMapP.getOrDefault(currChar, 0) + 1);
        }
        Map<Character, Integer> hMapCurr = new HashMap<>();
        int i = 0;
        int j = 0;
        while (j < lenP) {
            Character currChar = s.charAt(j);
            hMapCurr.put(currChar, hMapCurr.getOrDefault(currChar, 0) + 1);
            j++;
        }
        if (allCharSame(hMapCurr, hMapP)) {
            solList.add(0);
        }
        while (j < lenS) {
            Character newChar = s.charAt(j);
            Character pastChar = s.charAt(i);
            updateMap(hMapCurr, newChar, pastChar);
            if (allCharSame(hMapCurr, hMapP)) {
                solList.add(i + 1);
            }
            i++;
            j++;
        }
        return solList;
    }

    static void updateMap(Map<Character, Integer> hMapCurr,
                   Character newChar,
                   Character pastChar) {

        hMapCurr.put(newChar, hMapCurr.getOrDefault(newChar, 0) + 1);
        hMapCurr.put(pastChar, hMapCurr.get(pastChar) - 1);
    }

    static Boolean allCharSame(Map<Character, Integer> hMapCurr,
                        Map<Character, Integer> hMapP) {

        for (Character c : hMapP.keySet()) {
            if (!Objects.equals(hMapCurr.get(c), hMapP.get(c))) {
                return false;
            }
        }

        return true;

    }
}
